import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 29.1-341.1 Number of stationary blinds permitted; when erected.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/29.1-341.1.md","filePath":"vacode/29.1-341.1.md"}'),n={name:"vacode/29.1-341.1.md"},i=r('<h1 id="§-29-1-341-1-number-of-stationary-blinds-permitted-when-erected" tabindex="-1">§ 29.1-341.1 Number of stationary blinds permitted; when erected. <a class="header-anchor" href="#§-29-1-341-1-number-of-stationary-blinds-permitted-when-erected" aria-label="Permalink to &quot;§ 29.1-341.1 Number of stationary blinds permitted; when erected.&quot;">​</a></h1><p>Notwithstanding the provisions of § <a href="/vacode/29.1-340/">29.1-340</a>, clubs holding stationary waterfowl blind licenses in Virginia Beach may continue to renew stationary blinds in the public waters. In areas other than Virginia Beach, individuals who do not own riparian rights shall be permitted to license no more than two stationary blinds in the public waters in any one season. Stationary blinds shall be erected not later than November 1 of each year.</p><p>2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0422" target="_blank" rel="noreferrer">422</a>; 2020, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0415" target="_blank" rel="noreferrer">415</a>.</p>',3),o=[i];function s(d,l,c,h,_,p){return t(),a("div",null,o)}const m=e(n,[["render",s]]);export{f as __pageData,m as default};
